
// HTML-Canvas : PixelRain-1

export {} // avoid ts(1208)

// 참고 웹
// * Canvas API : <https://developer.mozilla.org/en-US/docs/Web/API/Canvas_API>
// * CanvasRenderingContext2D : <https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D>
//   * <https://developer.mozilla.org/en-US/docs/Web/API/CanvasRenderingContext2D/arc>
// * 캔바스 픽셀 레인 효과 : <https://www.youtube.com/watch?v=RCVxXgJ8xSk>
//   * 참고할 다른 사이트 <https://codepen.io/Mamboleoo/pen/GRJKoBw>
// * 그외
//   * [Manipulating colors in .NET - Part 1] : https://www.codeproject.com/Articles/19045/Manipulating-colors-in-NET-Part-1
//   * png to base64 : <https://www.base64-image.de/>

const myImage = new Image();
// search png to base64
myImage.src =
//#region image
// 'data:image/jpeg;base64,';
'data:image/png;base64,';
//#endregion

const canvas = <HTMLCanvasElement> document.getElementById('canvas');
const ctx:CanvasRenderingContext2D  = canvas.getContext('2d');
canvas.width = 400;
canvas.height = 400;

// 이미지 로딩은 lazy로딩. 로딩은 끝나면 기능 시작
myImage.addEventListener('load', function() {
    try1.start();
});

namespace try1 {
    let particlesArray:Particle[] = [];
    const numberOfParticles:number = 5000;
    let mappedImage:number[][][] = [];
    let brightnessMax:number = 0;

    class Particle {
        x:number;
        y:number;
        speed:number;
        velocity:number;
        size:number;
        position1:number;
        position2:number;
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = Math.random() * canvas.height;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;

            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            if(this.position1 < 0) {
                console.assert(this.position1 > 0, 'this.position1 > 0');
            }
            this.speed = mappedImage[this.position1][this.position2][0];
            let movement = (brightnessMax - this.speed) + this.velocity;

            this.y += movement;
            if( this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
        }
        draw() {
            ctx.beginPath();
            ctx.fillStyle = 'white';
            ctx.arc(this.x, this.y, this.size, 0, 2 * Math.PI);
            ctx.fill();
        }
    }

    function init() {
        for(let i = 0; i < numberOfParticles; i++) {
            particlesArray.push(new Particle);
        }

        ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
        ctx.clearRect(0,0,canvas.width,canvas.height);

        let _mappedImage:number[][][] = [];
        for(let y = 0; y < canvas.height; y++) {
            let row = [];
            for(let x = 0; x < canvas.width; x++) {
                const red   = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                const blue  = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                const brightness = calculateRelativeBrightness(red, green, blue);
                const cell = [ brightness ];
                if(brightness > brightnessMax) { brightnessMax = brightness; }
                row.push(cell);
            }
            _mappedImage.push(row);
        }
        console.log(_mappedImage);
        mappedImage = _mappedImage;
    }

    function calculateRelativeBrightness(r:number, g:number, b:number) {
        return Math.sqrt((r*r) * 0.299 + (g*g) * 0.587 + (b*b) * 0.114) / 100;
        //return (r * 0.2126 + g * 0.7152 + b * 0.722) / 100;
    }

    function animate() {
        //ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.1;
        particlesArray.forEach(particle => {
            particle.update();
            ctx.globalAlpha = particle.speed * 0.5;
            particle.draw();
        });
        requestAnimationFrame(animate);
    }

    export function start() {
        init();
        animate();
    }
};

